import React from 'react';

const Spacing = () => {
  const marginClasses = [
    { id: 500, classTitle: 'mAuto' },
    { id: 50, classTitle: 'm0' },
    { id: 51, classTitle: 'm1' },
    { id: 52, classTitle: 'm2' },
    { id: 53, classTitle: 'm3' },
    { id: 54, classTitle: 'm4' },
    { id: 55, classTitle: 'm5' },
    { id: 56, classTitle: 'm6' },
    { id: 57, classTitle: 'ml1' },
    { id: 58, classTitle: 'ml2' },
    { id: 59, classTitle: 'ml3' },
    { id: 60, classTitle: 'ml4' },
    { id: 61, classTitle: 'ml5' },
    { id: 62, classTitle: 'ml6' },
  ];
  const paddingClasses = [
    { id: 40, classTitle: 'p0' },
    { id: 41, classTitle: 'p1' },
    { id: 42, classTitle: 'p2' },
    { id: 43, classTitle: 'p3' },
    { id: 44, classTitle: 'p4' },
    { id: 45, classTitle: 'p5' },
    { id: 46, classTitle: 'p6' },
  ];

  const margClasses = [
    {
      marg: [
        { id: 60, classTitle: 'm0' },
        { id: 61, classTitle: 'm1' },
        { id: 62, classTitle: 'm2' },
        { id: 63, classTitle: 'm3' },
        { id: 64, classTitle: 'm4' },
        { id: 65, classTitle: 'm5' },
        { id: 66, classTitle: 'm6' },
      ],
    },
  ];

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle fontStyled primary'>
          <h5 className='fsH5 pb2'>Spacing</h5>
        </div>

        <div className='sectionTitle fontStyled primary'>
          <h6 className='fsSM pb1'>Margins</h6>
          <h6 className='fsSM pb1'>Classes Names</h6>
        </div>

        {marginClasses.map((mc) => (
          <div key={mc.id} className='row alignCenter'>
            <div className='col5 col4-xs col3-sm'>
              <div className={`bgLight`}>.{mc.classTitle}</div>
            </div>
            <div className='col7 col4-xs col3-sm bgPrimary border'>
              <div className={`bgLight textCenter ${mc.classTitle}`}>
                {mc.classTitle}
              </div>
            </div>
          </div>
        ))}

        <div className='sectionTitle fontStyled primary'>
          <h6 className='fsSM py1'>Paddings</h6>
          <h6 className='fsSM pb1'>Classes Names</h6>
        </div>

        {paddingClasses.map((pc) => (
          <div key={pc.id} className='row alignCenter'>
            <div className='col5 col4-xs'>
              <div className={`bgLight`}>.{pc.classTitle}</div>
            </div>

            <div className='col7 col4-xs textCenter light'>
              <div className={`border bgLight ${pc.classTitle}`}>
                <div className='bgPrimary'>{pc.classTitle}</div>
              </div>
            </div>

            {/* <div className='col7 border'>
              <div className={`textCenter ${pc.classTitle}`}>
                {pc.classTitle}
              </div>
            </div> */}
          </div>
        ))}
      </div>
    </>
  );
};

export default Spacing;

